import Styles from './inputGroup.module.css'

function InputGroup({ label, placeholder, type }) {
    return (
        <div className='mb-3'>
            <label className=''>{label}</label>
            <input type={type} placeholder={placeholder} />
        </div>
    )
}

export default InputGroup
